const EXAMPLE_FIG_DATA = `<meta charset='utf-8'><html><head><meta charset="utf-8"><meta charset="utf-8"></head><body><span data-metadata="<!--(figmeta)eyJmaWxlS2V5Ijoid2hhdGV2ZXIiLCJwYXN0ZUlEIjo3NzcsImRhdGFUeXBlIjoic2NlbmUifQ==(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space: pre-wrap"></span></body></html>`;

function App() {
  return (
    <div
      style={{
        width: "100vw",
        padding: "20px",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <code style={{ width: "100%" }}>{EXAMPLE_FIG_DATA}</code>
      <button
        style={{ marginTop: "40px" }}
        onClick={async () => {
          const blob = new Blob([EXAMPLE_FIG_DATA], { type: "text/html" });
          const finalData = [new ClipboardItem({ "text/html": blob })];
          await navigator.clipboard.write(finalData);
        }}
      >
        Copy as HTML
      </button>
    </div>
  );
}

export default App;
